import React from 'react';
import {RegistrationState} from './types'



export const initialState: RegistrationState = {
    firstname: '',
    secondname: '',
    email: '',
    password: '',
    errorFirstname: '',
    errorSecondname: '',
    errorEmail: '',
    errorPassword: ''
};

function reducer(state = initialState, action:any):any{
    let newObj = JSON.parse(JSON.stringify(state))
   
    switch (action.type){
      case 'ADD_OBJ':
        return {
          ...newObj,
          users: newObj.users.concat(action.obj)
        }
       
      default:
        return state;
    }
}
